import React, { Component } from "react";

class nameIntro extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <span
          style={{ fontFamily: "Unna", fontStyle: "italic", fontSize: 100 }}
        >
          Vivan &nbsp;
        </span>
        <span
          style={{
            fontFamily: "Unna",
            fontStyle: "Bold 700",
            fontSize: 100,
          }}
        >
          Marwaha
        </span>
      </React.Fragment>
    );
  }
}

export default nameIntro;
